import { React, useEffect, useState } from 'react';
import Axios from 'axios'




function Users() {
        

 
    const [users, setUsers] = useState([]);

    useEffect(() => {
        Axios.get('https://jsonplaceholder.typicode.com/users')
            .then(res => {
              
                setUsers(res.data)
            })
            .catch(err => console.log(err))

    }, []);

   const display=()=>
       users.slice(0,5).map((user, index) => {                     
        return  <tr key={index}>
           <td>{user.name}</td> 
           <td> {user.email}</td> 
           <td> {user.website}</td> 
                                   
      </tr> });            
  

   


    return (
        <div>
           <h1 id='center' > All Users</h1>
       
            <table id="myTable">
                <tbody>

                <tr>
                    <th>Name    <button > Sort by</button></th>
                    <th>Email   <button > Sort by</button></th>
                    <th>Website</th>
                </tr>
               
                  {display}

                </tbody>
               
                   

                

            </table>




        </div>
    );
}

export default Users;
